        .black {

        #wrapper {
            position: relative;
            width: 100%;
            margin: auto;
        }

        #header {
            width: 100%;
            padding: 100px 0 100px 0;
            margin: auto;
        }

        h1 {
            font-family: 'Damion', cursive;
            font-size: 103px;
        }

        h2 {
            font-family: 'Josefin Sans', sans-serif;
            font-size: 30px;
            letter-spacing: 4px;
        }

            h2 strong.sep-one {
                width: 60px;
                height: 1px;
                background: #fff;
                position: absolute;
                margin-left: -80px;
                margin-top: 15px;
            }

            h2 strong.sep-two {
                width: 60px;
                height: 1px;
                background: #fff;
                position: absolute;
                margin-left: 15px;
                margin-top: 15px;
            }

            background: #ffffff;
            padding: 10px 0;
            margin: 50px 0;

                    color: #e63b4d;
                }
